Odnoklassniki is a social network with millions of users around the world. In OK you can call friends, livestream, send stickers and gifts, find new friends in groups and share moments. Have fun listening to music, watching videos and playing games!

HOBBIES
— New service! Cooking, DIY, gardening, traveling, fishing, fashion, cars and pets - you can find all the most interesting things about your hobby in OK;
— Watch thousands of videos about your favorite topic;
— Haven’t found your hobby? Use the search bar, OK has millions of interesting posts.

MOMENTS
— Share your moments! Post photos and videos that will disappear after 24 hours;
— Use frames, stickers and animated texts to make your moments look even better;
— Add any links to the moments.

PRODUCTS
— Favorite AliExpress is in OK now, buy millions of products without extra charges;
— Get inspired, choose goods, discuss it with friends and buy easily;
— Buyer protection guaranteed.

COMMUNICATION
— Free audio and video calls with up to 100 participants;
— Congratulate friends and family, choose postcards and gifts for any holiday;
— Meet new people using the video dating service.

GROUPS
— From cooking to fishing! Join communities of interest or create your own group;
— Millions of proven tips from users for all occasions;
— Find jokes and entertainment in OK groups.

SERVICES and APPS
— Weather, TV program and Horoscope - find your favorite app;
— Public services and mobile payments to make your life easier;
— Business profiles with statistics, an advertising account and virtual telephony.

MUSIC
— A huge collection of songs, from new releases to favorite hits;
— Add songs to playlists or share it in the status on your page;
— Subscribe to Music to listen to songs in the background and download songs to the OK app.

VIDEO
— Watch concerts, popular shows and TV series;
— Sports broadcasts to cheer for your favorite teams;
— Live broadcasts to tell the world about yourself!

EASY REGISTRATION AND LOGIN
— Simple and fast registration;
— You can use other social networks to sign in;
— Lost access to your profile? It's easy to recover it via phone, email, or even face and gesture recognition.

Contact OK Support Team for any feedback: https://ok.ru/help. We will be glad to help you!

~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
Note:
• the "Music" service uses auto-renewal of the subscription;
• subscribe to “Music” to get access to the full collection of songs without ads, listen to music in the background, including without access to the Internet;
• the first 30 days of using the subscription are free;
• the subscription cost is:
169 rubles per month, including VAT, for users from Russia;
USD 3.99 including taxes in local currency for users from the following countries:
Azerbaijan, Armenia, Belarus, Georgia, Kazakhstan, Kyrgyzstan, Moldova, Russia, Tajikistan, Turkmenistan, Uzbekistan, Ukraine.
The "Music" service is not available in other countries.

Privacy policy: https://ok.ru/privacy?current.locale=en
License agreement: https://ok.ru/regulations?current.locale=en
Terms of use: https://ok.ru/help/7/4240/4260

Info for subscription owners:
• every month the subscription is renewed automatically, unless it was turned off 24 hours before the end of the current period;
• funds for the next month are debited on the last day of the paid period;
• when canceling a subscription, its effect is preserved until the end of the paid period;
• you can disable the subscription in your account settings;
• removing the application does not terminate the subscription.

Everyone has a very special day in a year - BirthDay!

On that day we finally get a chance to show ourselves as thoughtful, caring and loving person. Our main goal on someone’s birthday is a greeting. Just remember yourself on your birthday how it was wonderful to get lovely cards and kind wishes from people around you. Now it’s your turn! You turn to make people happy. And "BirthDay cards free" will assist you in it. 

"BirthDay cards free" is an eCards editor contains lots of birthday themed photos and images. You can choose between funny kittens, delicious-looking birthday cakes with candles, present boxes and guys in holiday caps. The app also allows you to compliment pictures with wishes, funny messages, poems and greeting texts. "BirthDay cards free" includes several editing options with which you change letters scale, make them shadowed; choose font type, color, transparency and alignment. Greetings can be shared via all available messenger apps and social media services.

Due to the simplest and convenient UI, "BirthDay cards free" will help you to create an exclusive greeting eCard in a blink of an eye.

The app's features:
* an elegant, clever, incredibly clean, and intuitive interface;
* adding images via camera, photo library, app’s gallery;
* history of applying images with the option to go to the last creation;
* cropping patterns (original, Instagram, Facebook, Twitter, Google+, etc);
* image filters;
* resizing, rotating and bending of text;
* 3D functions;
* selection of multiple texts to make simultaneous changes;
—-New-—
* copy any images from all over the world and paste them over cards;
* preservation of initial quality of images and of scaled text.

EXTRA FEATURE: 
iDeas gallery grants you use a ready-made design of eCards as the templates for further re-design and reuse.

"BirthDay cards free" is absolutely for free, but with ads. If you like the app then you might be interested in its full version - "iSmartMMS". "iSmartMMS" has a huge Gallery of photos and images for any occasions. And unlike the birthday version "iSmartMMS" allows you to use your own photos and pics if you’re not satisfied with the standard gallery.
